import logo from './logo.svg';
import './App.css';


import TransactionList from './Components/TransactionList.js';
import Statistics from './Components/Statistics.js';
import Transactiontable from './Components/TransactionDashboard.js';
function App() {
  return (
    <div className="App">

      <TransactionList />
            <Statistics />
            <Transactiontable/>
    </div>
  );
}

export default App;
